import React, { useState, useEffect } from 'react';

import Card from "./Card";
import axios from "axios";
const Main=()=>{
    const [data, setData] = useState([]);
    async function fetchData() {
        try {
          const response = await axios.get('https://www.googleapis.com/books/v1/volumes?q=flowers&orderBy=newest&key=AIzaSyBT6FQFWpyDXaOm2QeA8V_BaHlCIOHRtvg');
          setData(response.data);
        } catch (error) {
          console.log(error);
        }
      }

      useEffect(() => {
        fetchData();
      }, []);
    return(
        <>


            <div className="container">
                <div className="header">
                    <div className="logo">
                        <img src="./images/logofpt.png" alt=""/>
                    </div>
                    <div className="title">
                        <h1>THƯ VIỆN FPT POLYTECHNIC</h1>
                    </div>
                </div>
                <div className="content">
                    <div className="product">
                        <Card book={data}/>
                    </div>
                </div>
            </div>
        </>
    )
}
export default Main;
